import React from 'react'

import {useNavigate } from 'react-router-dom';
function BookList({books,deleteBooks}) {
    const navigate = useNavigate();
   


  return (
    <div className="page-content">

      {books.map((el)=>{
      <div className="card">
      <div className="image-container">
        <img 
          src="https://images.unsplash.com/photo-1517021897933-0e0319cfbc28?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=400&fit=max&ixid=eyJhcHBfaWQiOjE0NTg5fQ" 
          alt="Book Image 1" 
          className="card-image"
        />
      </div>
      <div className="content">
        <h2 className="title">{el.title}</h2>
        <p className="copy">{el.author}</p>
        <button className="btn" onClick={() => navigate("/detailes")}>View Trips</button>
      </div>
    </div>
    

      })}
      
    </div>
  )
}

export default BookList
